import React, { useEffect, useState } from "react";
import { Splide, SplideSlide } from "@splidejs/react-splide";
import "@splidejs/splide/dist/css/splide.min.css";
import { NavLink } from "react-router-dom";
import styles from "../components/Bounties.module.css";

const Bounties = (props) => {
  return (
    <div className={styles.bountyCardGroup}>
      <Splide
        options={{
          width: "50%",
          speed: "14000",
          autoplay: true,
          type: "loop",
          pauseOnHover: false,
          wheel: true,
          drag: true,
          easing: "linear",
          perPage: 4,
          pagination: false,
          interval: 0,
        }}
      >
        {props.bountyData.map((element) => {
          return (
            <SplideSlide
              data-aos="fade-right"
              data-aos-easing="ease-in-out"
              data-aos-delay="50"
              data-aos-duration="1000"
            >
              <div className={styles.bountyCard}>
                <img
                  className={styles.bountyImage}
                  src={element.url1}
                  alt=""
                ></img>

                <h3>{element.bounty} CREDITS</h3>
              </div>
            </SplideSlide>
          );
        })}
      </Splide>
      ;
    </div>
  );
};

export default Bounties;
